tables.table_schema:
CREATE TABLE ClientPreferences (
  client_id UUID PRIMARY KEY,
  style_preference TEXT,
  budget_range INT
);

CREATE TABLE client_preferences (
    client_id INT PRIMARY KEY,
    fashion_style VARCHAR,
    color_preferences VARCHAR,
    size_preferences VARCHAR
);

CREATE TABLE feedback (
    feedback_id INT PRIMARY KEY,
    client_id INT REFERENCES client_preferences(client_id),
    rating INT,
    comment TEXT
);

CREATE TABLE past_orders (
    order_id INT PRIMARY KEY,
    client_id INT REFERENCES client_preferences(client_id),
    order_date DATE,
    total_amount DECIMAL
);

CREATE TABLE client_preferences (
    client_id INT PRIMARY KEY,
    style_preference VARCHAR(255),
    location_preference VARCHAR(255)
);

CREATE TABLE client_feedback (
    feedback_id INT PRIMARY KEY,
    client_id INT,
    rating INT,
    comment TEXT
);

CREATE TABLE client_orders (
    order_id INT PRIMARY KEY,
    client_id INT,
    service_type VARCHAR(255),
    order_date DATE
);

CREATE TABLE personalized_experience (
    experience_id INT PRIMARY KEY,
    client_id INT,
    personalized_message TEXT,
    recommendation VARCHAR(255)
);

CREATE TABLE ClientPreferences (
  client_id INT PRIMARY KEY,
  photography_style VARCHAR(50),
  preferred_photographer VARCHAR(50),
  preferred_location VARCHAR(100)
);

CREATE TABLE Photographer (
  photographer_id INT PRIMARY KEY,
  photographer_name VARCHAR(50),
  photography_style VARCHAR(50)
);
